import React, { useState, useEffect } from "react";
import { useNavigate, useParams } from "react-router-dom";

// Mock service data (for illustration)
const mockServices = [
    {
        id: 1,
        name: "Pension Form",
        description: "Help with pension form submissions",
        document1: "Pension ID",
        document2: "Bank Passbook",
        document3: "Aadhar Card",
    },
    {
        id: 2,
        name: "Insurance Form",
        description: "Fill out your insurance claim",
        document1: "Insurance Policy",
        document2: "Claim Form",
        document3: "Aadhar Card",
    },
];

function ClientForm() {
    const { serviceId } = useParams();
    const [service, setService] = useState(null);
    const [formData, setFormData] = useState({
        fullName: "",
        mobile: "",
        email: "",
        documents: [],
    });

    const navigate = useNavigate();

    // Find the service based on the serviceId
    useEffect(() => {
        const selectedService = mockServices.find(
            (service) => service.id === parseInt(serviceId)
        );
        setService(selectedService);
    }, [serviceId]);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: value,
        }));
    };

    const handleFileChange = (e) => {
        setFormData((prevData) => ({
            ...prevData,
            documents: [...prevData.documents, ...e.target.files],
        }));
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("Client form submitted with data:", formData);

        // Navigate to a confirmation or success page
        navigate("/services");
    };

    if (!service) {
        return <div>Loading...</div>;
    }

    return (
        <div className="min-h-screen bg-gray-50 p-8">
            <div className="max-w-2xl mx-auto bg-white p-8 rounded-lg shadow-lg">
                <h2 className="text-3xl font-semibold text-gray-800 mb-6">{service.name} - Apply</h2>
                <form onSubmit={handleSubmit}>
                    <div className="space-y-4">
                        <div>
                            <label htmlFor="fullName" className="block text-sm font-medium text-gray-700">
                                Full Name
                            </label>
                            <input
                                type="text"
                                name="fullName"
                                value={formData.fullName}
                                onChange={handleChange}
                                className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 p-2"
                                placeholder="Enter your full name"
                                required
                            />
                        </div>

                        <div>
                            <label htmlFor="mobile" className="block text-sm font-medium text-gray-700">
                                Mobile Number
                            </label>
                            <input
                                type="text"
                                name="mobile"
                                value={formData.mobile}
                                onChange={handleChange}
                                className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 p-2"
                                placeholder="Enter your mobile number"
                                required
                            />
                        </div>

                        <div>
                            <label htmlFor="email" className="block text-sm font-medium text-gray-700">
                                Email Address
                            </label>
                            <input
                                type="email"
                                name="email"
                                value={formData.email}
                                onChange={handleChange}
                                className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 p-2"
                                placeholder="Enter your email address"
                                required
                            />
                        </div>

                        <div>
                            <label htmlFor="documents" className="block text-sm font-medium text-gray-700">
                                Attach Documents
                            </label>
                            <input
                                type="file"
                                name="documents"
                                onChange={handleFileChange}
                                className="mt-1 block w-full border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 p-2"
                                multiple
                                required
                            />
                        </div>
                    </div>

                    <div className="flex justify-between mt-6">
                        <button
                            type="submit"
                            className="bg-green-600 text-white px-6 py-2 rounded-md hover:bg-green-700 transition duration-300"
                        >
                            Submit
                        </button>
                        <button
                            type="button"
                            onClick={() => navigate("/services")}
                            className="bg-gray-600 text-white px-6 py-2 rounded-md hover:bg-gray-700 transition duration-300"
                        >
                            Cancel
                        </button>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default ClientForm;
